    const {textInput,type ,className,spanTextA,spanTextB} = props;
    
    switch (type){
        case 'h1':
            return <h1 className={className}><span>{spanText}</span>{textInputB}<span>{spanTextA}</span></h1>
        case 'h2':
            return <h2 className={className}>{textInput}</h2>
        default:
            return <p className={className}>{textInput}</p>

    }
   
 }
export default Text
